import React, {useState} from 'react';
import { Link } from 'react-router-dom';

function NavBar() {
    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to="/" className="navbar-logo">
                        TRVL <i className="fab fa-type3"></i>
                    </Link>
                </div>
            </nav>
        </>
    )
}

export default NavBar
